properties.description:
Nel cuore del Lazio, nei dintorni del Parco Vejo, precisamente in strada del Sorbo, proponiamo in vendita un'esclusiva proprietà, costruita nel 1980 per un totale di circa 700 mq, circondata da verde per lo più pianeggiante di circa 3 ettari con 60 piante di ulivi ed alberi fruttiferi, è composta da 4 unità abitative come segue:

- la villa padronale è disposta quasi esclusivamente su unico livello per un totale di 411 mq;
- la seconda unità abitativa ha una superfice di 158 mq;
- la terza unità abitativa ha una superfice di 73 mq;
- la quarta unità abitativa ha una superfice di 52 mq;
- il deposito di 59 mq;
- il terreno che circonda l'intera proprietà ha una superfice di 30.000 mt.

 La proprietà disponibile da subito, è ideale per una o più famiglie in quanto il terreno può essere divis
